import React from 'react';
import { Box, Heading } from 'grommet';

const locationInput = ({ toggleUi }) => {
  return (
    <Box>
      <Heading>Location Input</Heading>
      <button onClick={() => toggleUi("landing")}>Click here to go back to main</button>
    </Box>
  )
}

export default locationInput;
